CREATE FUNCTION public.balance_states_coins_to_text(balance_states_row public.balance_states) RETURNS json
    LANGUAGE sql STABLE
    AS $$
	select
	json_agg(json_build_object(
        'denom',
	coin.denom,
	'amount',
	coin.amount::text
    )) as json_result
from
	unnest( balance_states_row.coins )as coin;
$$;
CREATE TABLE public.module_accounts (
    address text NOT NULL,
    name text,
    account_type text,
    description text,
    region_id text
);
CREATE FUNCTION public.create_module_account_type(ma public.module_accounts) RETURNS text
    LANGUAGE plpgsql STABLE
    AS $$
begin
return case
           when ma.account_type = ma.name then ma.name
           else  ma.account_type || '_' || ma.name
    end;
end;
$$;
CREATE TABLE public.daily_tx_count_result (
    id integer,
    record_date date,
    nums bigint
);
CREATE FUNCTION public.daily_tx_count_func(start_date date, end_date date) RETURNS SETOF public.daily_tx_count_result
    LANGUAGE plpgsql STABLE
    AS $$
BEGIN
    RETURN QUERY
    SELECT 
        row_number() OVER (ORDER BY record_date)::integer AS id,
        record_date,
        nums
    FROM (
        SELECT 
            (b."timestamp" AT TIME ZONE 'UTC')::date AS record_date,
            SUM(b.num_txs) AS nums
        FROM 
            block b
        WHERE 
            (b."timestamp" AT TIME ZONE 'UTC')::date BETWEEN start_date AND end_date
        GROUP BY 
            (b."timestamp" AT TIME ZONE 'UTC')::date
    ) subquery;
END;
$$;
CREATE FUNCTION public.decrement_proposer_tx_summary() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
    UPDATE proposer_tx_summary
    SET total_txs = total_txs - OLD.num_txs
    WHERE proposer_address = OLD.proposer_address;
    -- 可选: 如果total_txs减到0或以下，可以选择删除该行
    DELETE FROM proposer_tx_summary
    WHERE proposer_address = OLD.proposer_address AND total_txs <= 0;
    RETURN OLD;
END;
$$;
CREATE TABLE public.event_of_msgs_result (
    transaction_hash text NOT NULL,
    index bigint NOT NULL,
    height bigint NOT NULL,
    type text NOT NULL,
    description text,
    success boolean NOT NULL,
    "timestamp" timestamp with time zone NOT NULL,
    events jsonb NOT NULL
);
CREATE FUNCTION public.event_of_msgs_func(address text, p_filter_type text[]) RETURNS SETOF public.event_of_msgs_result
    LANGUAGE plpgsql STABLE
    AS $$
BEGIN
    RETURN QUERY
	WITH 
	account_msg AS (
        SELECT
            m.transaction_hash as tx_hash,
            m."index",
            m.height,
            m."type",
			m.partition_id
        FROM public.message m
        WHERE ARRAY[address] <@ ARRAY[m.involved_accounts_addresses]
    ),
	parsed_msg AS (
		select
			m.*,
			pm.description,
	        CASE 
	            WHEN pm.msg_type = 'gea.kyc.MsgStar' THEN pm.detail['star'] -- complex：jsonb_build_object('star_level', pm.detail->'star'->>'level','star_oldlevel', pm.detail->'star'->>'old_level')
				ELSE NULL
	        END AS events
		from account_msg m
		left join public.parsed_message	pm ON m.height = pm.height AND m.tx_hash = pm.tx_hash AND m."index" = pm.msg_index
	),
	business_type AS (
		SELECT 
			bf.business_type, 
			bf.filter_content
        FROM public.business_filter bf
        WHERE bf.business_type && p_filter_type
	),
	msg_base AS (
		select m.*
		from parsed_msg m
		join business_type bt
		on m."type" = bt.filter_content OR m.description = bt.filter_content
	)
	select
		m.tx_hash,
	    m."index",
	    m.height,
	    m."type",
		m.description,
		t.success,
		b."timestamp",
		m.events
	from msg_base m
	left join public."transaction" t
	on m.partition_id = t.partition_id and m.tx_hash = t.hash
	left join public.block b
	ON b.height = m.height;
END;
$$;
CREATE FUNCTION public.format_big_int_coin(public.big_int_coin[]) RETURNS text[]
    LANGUAGE plpgsql
    AS $_$
DECLARE
    result text[];
    coin big_int_coin;
BEGIN
    FOREACH coin IN ARRAY $1 LOOP
        result := array_append(result, coin.amount::text || coin.denom);
    END LOOP;
    RETURN result;
END;
$_$;
CREATE TABLE public.message (
    transaction_hash text NOT NULL,
    index bigint NOT NULL,
    type text NOT NULL,
    value json NOT NULL,
    involved_accounts_addresses text[] NOT NULL,
    partition_id bigint DEFAULT 0 NOT NULL,
    height bigint NOT NULL
)
PARTITION BY LIST (partition_id);
CREATE FUNCTION public.get_extra_msg_info(m public.message) RETURNS json
    LANGUAGE plpgsql STABLE
    AS $$
BEGIN
    RETURN
(SELECT case
            when m.type = 'gea.kyc.MsgUpdate' and pm.detail ? 'delegate_interest_info' then
                jsonb_build_object(
                    'interest', (pm.detail -> 'delegate_interest_info' -> 'interest')
                )
            when m.type = 'gea.staking.MsgSwap' then
                jsonb_build_object(
                        'in_amount', pm.detail -> 'token_in_amount',
                        'out_amount', pm.detail -> 'token_out_amount'
                )
            when m.type = 'gea.staking.MsgCreateFixedDelegation' then
                jsonb_build_object(
                        'amount', pm.detail -> 'create_fixed_delegation' -> 'amount',
                        'region_id', (pm.detail -> 'create_fixed_delegation' -> 'region_id'),
                        'term', (pm.detail -> 'create_fixed_delegation' -> 'fixed_deposit_period'),
                        'interest', (pm.detail -> 'delegate_interest_info' -> 'interest')
                )
            when m.type = 'gea.staking.MsgWithdrawFixedDelegation' then
                jsonb_build_object(
                        'amount', pm.detail -> 'withdraw_fixed_delegation' -> 'amount',
                        'region_id', (pm.detail -> 'withdraw_fixed_delegation' -> 'region_id'),
                        'term', (pm.detail -> 'withdraw_fixed_delegation' -> 'fixed_deposit_period'),
                        'interest', (pm.detail -> 'delegate_interest_info' -> 'interest')
                )
            when m.type = 'gea.staking.MsgCreateDelegate' then
                jsonb_build_object(
                        'region_id', (pm.detail -> 'do_delegate' -> 'region_id'),
                        'amount', pm.detail -> 'do_delegate' -> 'amount',
                        'interest', (pm.detail -> 'delegate_interest_info' -> 'interest')
                )
            when m.type = 'gea.staking.MsgUnDelegate' then
                jsonb_build_object(
                        'region_id', (pm.detail -> 'undelegate' -> 'region_id'),
                        'amount', pm.detail -> 'undelegate' -> 'amount',
                        'interest', (pm.detail -> 'delegate_interest_info' -> 'interest')
                )
            when m.type = 'gea.staking.MsgCreateLockUpDelegate' then
                jsonb_build_object(
                        'region_id', (pm.detail -> 'create_lock_up_delegation' -> 'region_id'),
                        'amount', pm.detail -> 'create_lock_up_delegation' -> 'amount',
                        'interest', (pm.detail -> 'delegate_interest_info' -> 'interest')
                )
            when m.type = 'gea.staking.MsgReduceLockUpDelegation' then
                jsonb_build_object(
                        'region_id', (pm.detail -> 'reduce_lock_up_delegation' -> 'region_id'),
                        'amount', pm.detail -> 'reduce_lock_up_delegation' -> 'amount',
                        'interest', (pm.detail -> 'delegate_interest_info' -> 'interest')
                )
            when m.type = 'gea.staking.MsgTransferRegion' then
                jsonb_build_object(
                        'kyc_amount', (pm.detail -> 'common_region_transfer' -> 'kyc_reward'),
                        'interest', (pm.detail -> 'delegate_interest_info' -> 'interest')
                )
            when m.type = 'gea.staking.MsgKycUsersTransferToNewRegion' then
                jsonb_build_object(
                        'kyc_amount', (pm.detail -> 'users_transfer_to_new_region' -> 'kyc_reward'),
                        'lockup_amount', (pm.detail -> 'users_transfer_to_new_region' -> 'total_lock_up_amount'),
                        'delegate_interest', (pm.detail -> 'users_transfer_to_new_region' -> 'total_delegate_interest'),
                        'kyc_interest', (pm.detail -> 'users_transfer_to_new_region' -> 'total_kyc_interest'),
                        'fixed_interest', (pm.detail -> 'users_transfer_to_new_region' -> 'total_fixed_interest'),
                        'lock_up_interest', (pm.detail -> 'users_transfer_to_new_region' -> 'total_lock_up_interest')
                )
            when m.type = 'gea.staking.MsgWithdrawDelegationInterest' then
                jsonb_build_object(
                        'region_id', (pm.detail -> 'withdraw_delegate_interest' -> 'region_id'),
                        'interest', (pm.detail -> 'withdraw_delegate_interest' -> 'interest')
                )
            when m.type = 'gea.staking.MsgWithdrawLockUpReward' then
                jsonb_build_object(
                        'region_id', (pm.detail -> 'region_id'),
                        'interest', (pm.detail -> 'lock_up_interest_ugea')
                )
            when m.type = 'gea.staking.MsgUpdateDelegatorAddress' then
                jsonb_build_object(
                        'delegation_amount', (pm.detail -> 'update_delegator_address' -> 'total_delegation_amount'),
                        'fixed_amount', (pm.detail -> 'update_delegator_address' -> 'total_fixed_amount'),
                        'lock_up_amount', (pm.detail -> 'update_delegator_address' -> 'total_lock_up_amount')
                )
            else
                null
            end
 FROM parsed_message pm
 where m.transaction_hash = pm.tx_hash
   and m.index = pm.msg_index
   AND m.type = ANY (ARRAY[
     'gea.kyc.MsgUpdate':: text,
     'gea.staking.MsgSwap':: text,
     'gea.staking.MsgCreateFixedDelegation':: text,
     'gea.staking.MsgWithdrawFixedDelegation':: text,
     'gea.staking.MsgCreateDelegate':: text,
     'gea.staking.MsgUnDelegate':: text,
     'gea.staking.MsgCreateLockUpDelegate':: text,
     'gea.staking.MsgReduceLockUpDelegation':: text,
     'gea.staking.MsgTransferRegion':: text,
     'gea.staking.MsgKycUsersTransferToNewRegion':: text,
     'gea.staking.MsgWithdrawDelegationInterest':: text,
     'gea.staking.MsgWithdrawLockUpReward':: text,
     'gea.staking.MsgUpdateDelegatorAddress':: text
     ]));
END;
$$;
CREATE TABLE public.block (
    height bigint NOT NULL,
    hash text NOT NULL,
    num_txs integer DEFAULT 0,
    total_gas bigint DEFAULT 0,
    proposer_address text,
    "timestamp" timestamp with time zone NOT NULL
)
WITH (autovacuum_vacuum_scale_factor='0', autovacuum_analyze_scale_factor='0', autovacuum_vacuum_threshold='10000', autovacuum_analyze_threshold='10000');
CREATE FUNCTION public.get_mint_record_value(block_obj public.block) RETURNS text
    LANGUAGE sql STABLE
    AS $$
SELECT mint
from public.mint_records mr
where block_obj.height >= mr.start_height
  and mr.end_height >= block_obj.height;
$$;
CREATE TABLE public.always_null_table_token_txs_counts (
    count bigint NOT NULL,
    denom text DEFAULT 0
);
CREATE FUNCTION public.ibc_tx_count_by_address(address text, "limit" bigint DEFAULT 100, "offset" bigint DEFAULT 0) RETURNS SETOF public.always_null_table_token_txs_counts
    LANGUAGE sql STABLE
    AS $$
select
	count(distinct sub1.tx_hash) as count,
	sub1.denom
from
	(
	select
		subq.tx_hash,
		it.denom
	from
		ibc_tokens it
	right join (
		select
			tim.tx_hash,
			tim.token_types
		from
			transfer_in_msgs tim
		where
			tim.has_ibc_token = true
			and tim.invoke_address @>array[address]) subq on
		subq.token_types @> array[it.denom]) sub1
group by
	sub1.denom;
$$;
CREATE FUNCTION public.messages_by_address(addresses text[], types text[], "limit" bigint DEFAULT 100, "offset" bigint DEFAULT 0) RETURNS SETOF public.message
    LANGUAGE sql STABLE
    AS $$
SELECT * FROM message
WHERE (cardinality(types) = 0 OR type = ANY (types))
  AND addresses && involved_accounts_addresses
ORDER BY height DESC LIMIT "limit" OFFSET "offset"
$$;
CREATE FUNCTION public.messages_by_type(types text[], "limit" bigint DEFAULT 100, "offset" bigint DEFAULT 0) RETURNS SETOF public.message
    LANGUAGE sql STABLE
    AS $$ 
SELECT * FROM message
WHERE (cardinality(types) = 0 OR type = ANY (types))
ORDER BY height DESC LIMIT "limit" OFFSET "offset" 
$$;
CREATE FUNCTION public.query_region_detail(addressset text[], regionid text) RETURNS TABLE(delegationaddresscount bigint, fixedaddresscount bigint, lockupaddresscount bigint, curdelegationinterest numeric, curlockupinterest numeric, amountset text[])
    LANGUAGE plpgsql
    AS $$
BEGIN RETURN QUERY
SELECT COUNT(CASE WHEN sc.has_delegation = TRUE THEN 1 END)      AS delegationAddressCount,
       COUNT(CASE WHEN sc.has_fixed_deposit = TRUE THEN 1 END)   AS fixedAddressCount,
       COUNT(CASE WHEN sc.has_lock_up_deposit = TRUE THEN 1 END) AS lockupAddressCount,
       MAX(rs.current_total_delegation_interest)                 AS curDelegationInterest,
       MAX(rs.current_total_lockup_interest)                     AS curLockupInterest,
       (SELECT ARRAY_AGG(DISTINCT bs.address||':'||bs.ugea_amount::TEXT )
        FROM public.balance_states bs
        WHERE bs.address = ANY (addressSet))                     AS amountSet
FROM public.staking_counts sc
         LEFT JOIN public.region_total_interests rs ON rs.region_id = regionID
WHERE sc.region_id = regionID;
END;
$$;
CREATE TABLE public.transfer_of_msgs_result (
    transaction_hash text NOT NULL,
    index bigint NOT NULL,
    height bigint NOT NULL,
    type text NOT NULL,
    description text,
    events json,
    success boolean NOT NULL,
    "timestamp" timestamp with time zone NOT NULL,
    income_ugea numeric,
    income_ugag numeric,
    expend_ugea numeric,
    expend_ugag numeric
);
CREATE FUNCTION public.transfer_of_msgs_func(address text, p_filter_type text[], start_time timestamp with time zone, end_time timestamp with time zone) RETURNS SETOF public.transfer_of_msgs_result
    LANGUAGE plpgsql STABLE
    AS $$
BEGIN
    RETURN QUERY
    WITH account_msg AS (
        SELECT
            m.transaction_hash as tx_hash,
            m."index",
            m.height,
            m."type",
			m.partition_id
        FROM public.message m
        WHERE ARRAY[address] <@ ARRAY[m.involved_accounts_addresses]
    ),
	timed_block AS (
		SELECT 
			b.height, 
			b."timestamp"
        FROM public.block b
        WHERE b."timestamp" BETWEEN start_time AND end_time
	),
	timed_msg AS (
		select 
			m.*,
			b."timestamp"
		from 
			account_msg m, 
			timed_block b
		WHERE m.height = b.height
	),
	parsed_msg AS (
		select
			m.*,
			pm.description,
			CASE
				WHEN pm.msg_type = 'gea.kyc.MsgApprove' THEN
		    	json_build_object(
					'account', pm.detail->'reward'->>'account',
					'kyc_reward', pm.detail->'reward'->>'kyc_reward'
		        )
			END AS events
		from timed_msg m
		left join public.parsed_message	pm ON m.height = pm.height AND m.tx_hash = pm.tx_hash AND m."index" = pm.msg_index
	),
	business_type AS (
		SELECT 
			bf.business_type, 
			bf.filter_content
        FROM public.business_filter bf
        WHERE bf.business_type && p_filter_type
	),
	-- 完成消息过滤，确定msg_base
	msg_base AS MATERIALIZED (
		select m.*
		from parsed_msg m
		join business_type bt
		on m."type" = bt.filter_content OR m.description = bt.filter_content
	),
	msg_base_with_success AS (
		select
			m.*,
			t.success
		from msg_base m
		left join public."transaction" t
		on m.partition_id = t.partition_id and m.tx_hash = t.hash
	),
	msg_transfers AS (
		SELECT tim.*
        FROM public.transfer_in_msgs tim, msg_base m
        WHERE 
			tim.height = m.height
			AND tim.tx_hash = m.tx_hash
			AND tim.msg_index = m."index"
	),
	msg_income AS (
		SELECT 
			tx_hash, 
			msg_index,
			SUM(ugea) as income_ugea, 
			SUM(ugag) as income_ugag
        FROM msg_transfers
        WHERE receiver = address AND msg_type != 'gas_fee'
        GROUP BY height, tx_hash, msg_index, receiver
	),
	msg_expend AS (
		SELECT 
			tx_hash, 
			msg_index,
			SUM(ugea) as expend_ugea, 
			SUM(ugag) as expend_ugag
        FROM msg_transfers
        WHERE sender = address AND msg_type != 'gas_fee'
        GROUP BY height, tx_hash, msg_index, sender
	)
    SELECT
        m.tx_hash,
        m."index",
        m.height,
        m."type",
        m.description,
        m.events,
        m.success,
        m."timestamp",
        mi.income_ugea,
        mi.income_ugag,
        me.expend_ugea,
        me.expend_ugag
    FROM
        msg_base_with_success m
    LEFT JOIN msg_income mi ON mi.tx_hash = m.tx_hash AND mi.msg_index = m."index"
    LEFT JOIN msg_expend me ON me.tx_hash = m.tx_hash AND me.msg_index = m."index";
END;
$$;
CREATE FUNCTION public.update_block_count() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN IF TG_OP = 'INSERT' THEN
UPDATE public.block_transaction_count
SET total_block_rows   = total_block_rows + 1,
    last_updated_block = NOW();
ELSIF TG_OP = 'DELETE' THEN
UPDATE public.block_transaction_count
SET total_block_rows   = total_block_rows - 1,
    last_updated_block = NOW();
END IF;
RETURN NULL;
END;
$$;
CREATE FUNCTION public.update_proposer_tx_summary() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
    INSERT INTO proposer_tx_summary (proposer_address, total_txs)
    VALUES (NEW.proposer_address, NEW.num_txs)
    ON CONFLICT (proposer_address)
    DO UPDATE SET total_txs = proposer_tx_summary.total_txs + NEW.num_txs;
    RETURN NEW;
END;
$$;
CREATE FUNCTION public.update_staking_address_count() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
    old_region_id text;
    new_region_id text;
BEGIN
    -- 获取旧数据和新数据的region_id
    IF TG_OP = 'DELETE' THEN
        old_region_id := OLD.region_id;
    ELSIF TG_OP = 'INSERT' THEN
        new_region_id := NEW.region_id;
    ELSIF TG_OP = 'UPDATE' THEN
        old_region_id := OLD.region_id;
        new_region_id := NEW.region_id;
    END IF;
    -- 处理删除操作或region_id变更的情况
    IF TG_OP = 'DELETE' OR (TG_OP = 'UPDATE' AND old_region_id != new_region_id) THEN
        -- 减少旧region的地址计数
        INSERT INTO public.staking_address_count (region_id, address_count)
        VALUES (old_region_id, 0)
        ON CONFLICT (region_id) DO UPDATE SET
            address_count = GREATEST(0, staking_address_count.address_count - 1),
            updated_at = CURRENT_TIMESTAMP;
    END IF;
    -- 处理插入操作或region_id变更的情况
    IF TG_OP = 'INSERT' OR (TG_OP = 'UPDATE' AND old_region_id != new_region_id) THEN
        -- 增加新region的地址计数
        INSERT INTO public.staking_address_count (region_id, address_count)
        VALUES (new_region_id, 1)
        ON CONFLICT (region_id) DO UPDATE SET
            address_count = staking_address_count.address_count + 1,
            updated_at = CURRENT_TIMESTAMP;
    END IF;
    -- 返回适当的记录
    IF TG_OP = 'DELETE' THEN
        RETURN OLD;
    ELSE
        RETURN NEW;
    END IF;
END;
$$;
CREATE FUNCTION public.update_staking_stats_by_region() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
    old_region_id text;
    new_region_id text;
BEGIN
    -- 获取旧数据和新数据的region_id
    IF TG_OP = 'DELETE' THEN
        old_region_id := OLD.region_id;
    ELSIF TG_OP = 'INSERT' THEN
        new_region_id := NEW.region_id;
    ELSIF TG_OP = 'UPDATE' THEN
        old_region_id := OLD.region_id;
        new_region_id := NEW.region_id;
    END IF;
    -- 处理删除操作或更新操作的旧数据
    IF TG_OP = 'DELETE' OR (TG_OP = 'UPDATE' AND old_region_id != new_region_id) THEN
        INSERT INTO public.staking_stats_by_region (
            region_id,
            has_delegation_count,
            has_fixed_deposit_count,
            has_lock_up_deposit_count,
            has_kyc_count,
            total_delegation_amount,
            total_kyc_amount,
            total_fixed_deposit_amount,
            total_lock_up_deposit_amount
        )
        VALUES (old_region_id, 0, 0, 0, 0, 0, 0, 0, 0)
        ON CONFLICT (region_id) DO UPDATE SET
            has_delegation_count = staking_stats_by_region.has_delegation_count - 
                CASE WHEN OLD.has_delegation THEN 1 ELSE 0 END,
            has_fixed_deposit_count = staking_stats_by_region.has_fixed_deposit_count - 
                CASE WHEN OLD.has_fixed_deposit THEN 1 ELSE 0 END,
            has_lock_up_deposit_count = staking_stats_by_region.has_lock_up_deposit_count - 
                CASE WHEN OLD.has_lock_up_deposit THEN 1 ELSE 0 END,
            has_kyc_count = staking_stats_by_region.has_kyc_count - 
                CASE WHEN OLD.has_kyc THEN 1 ELSE 0 END,
            total_delegation_amount = staking_stats_by_region.total_delegation_amount - 
                COALESCE(OLD.delegation_amount, 0),
            total_kyc_amount = staking_stats_by_region.total_kyc_amount - 
                COALESCE(OLD.kyc_amount, 0),
            total_fixed_deposit_amount = staking_stats_by_region.total_fixed_deposit_amount - 
                COALESCE(OLD.fixed_deposit_amount, 0),
            total_lock_up_deposit_amount = staking_stats_by_region.total_lock_up_deposit_amount - 
                COALESCE(OLD.lock_up_deposit_amount, 0),
            updated_at = CURRENT_TIMESTAMP;
    END IF;
    -- 处理插入操作或更新操作的新数据
    IF TG_OP = 'INSERT' OR TG_OP = 'UPDATE' THEN
        INSERT INTO public.staking_stats_by_region (
            region_id,
            has_delegation_count,
            has_fixed_deposit_count,
            has_lock_up_deposit_count,
            has_kyc_count,
            total_delegation_amount,
            total_kyc_amount,
            total_fixed_deposit_amount,
            total_lock_up_deposit_amount
        )
        VALUES (
            new_region_id,
            CASE WHEN NEW.has_delegation THEN 1 ELSE 0 END,
            CASE WHEN NEW.has_fixed_deposit THEN 1 ELSE 0 END,
            CASE WHEN NEW.has_lock_up_deposit THEN 1 ELSE 0 END,
            CASE WHEN NEW.has_kyc THEN 1 ELSE 0 END,
            COALESCE(NEW.delegation_amount, 0),
            COALESCE(NEW.kyc_amount, 0),
            COALESCE(NEW.fixed_deposit_amount, 0),
            COALESCE(NEW.lock_up_deposit_amount, 0)
        )
        ON CONFLICT (region_id) DO UPDATE SET
            has_delegation_count = staking_stats_by_region.has_delegation_count + 
                CASE WHEN NEW.has_delegation THEN 1 ELSE 0 END - 
                CASE WHEN TG_OP = 'UPDATE' AND OLD.has_delegation THEN 1 ELSE 0 END,
            has_fixed_deposit_count = staking_stats_by_region.has_fixed_deposit_count + 
                CASE WHEN NEW.has_fixed_deposit THEN 1 ELSE 0 END - 
                CASE WHEN TG_OP = 'UPDATE' AND OLD.has_fixed_deposit THEN 1 ELSE 0 END,
            has_lock_up_deposit_count = staking_stats_by_region.has_lock_up_deposit_count + 
                CASE WHEN NEW.has_lock_up_deposit THEN 1 ELSE 0 END - 
                CASE WHEN TG_OP = 'UPDATE' AND OLD.has_lock_up_deposit THEN 1 ELSE 0 END,
            has_kyc_count = staking_stats_by_region.has_kyc_count + 
                CASE WHEN NEW.has_kyc THEN 1 ELSE 0 END - 
                CASE WHEN TG_OP = 'UPDATE' AND OLD.has_kyc THEN 1 ELSE 0 END,
            total_delegation_amount = staking_stats_by_region.total_delegation_amount + 
                COALESCE(NEW.delegation_amount, 0) - 
                CASE WHEN TG_OP = 'UPDATE' THEN COALESCE(OLD.delegation_amount, 0) ELSE 0 END,
            total_kyc_amount = staking_stats_by_region.total_kyc_amount + 
                COALESCE(NEW.kyc_amount, 0) - 
                CASE WHEN TG_OP = 'UPDATE' THEN COALESCE(OLD.kyc_amount, 0) ELSE 0 END,
            total_fixed_deposit_amount = staking_stats_by_region.total_fixed_deposit_amount + 
                COALESCE(NEW.fixed_deposit_amount, 0) - 
                CASE WHEN TG_OP = 'UPDATE' THEN COALESCE(OLD.fixed_deposit_amount, 0) ELSE 0 END,
            total_lock_up_deposit_amount = staking_stats_by_region.total_lock_up_deposit_amount + 
                COALESCE(NEW.lock_up_deposit_amount, 0) - 
                CASE WHEN TG_OP = 'UPDATE' THEN COALESCE(OLD.lock_up_deposit_amount, 0) ELSE 0 END,
            updated_at = CURRENT_TIMESTAMP;
    END IF;
    -- 返回适当的记录
    IF TG_OP = 'DELETE' THEN
        RETURN OLD;
    ELSE
        RETURN NEW;
    END IF;
END;
$$;
CREATE FUNCTION public.update_transaction_count() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN IF TG_OP = 'INSERT' THEN
UPDATE public.block_transaction_count
SET total_transaction_rows   = total_transaction_rows + 1,
    last_updated_transaction = NOW();
ELSIF TG_OP = 'DELETE' THEN
UPDATE public.block_transaction_count
SET total_transaction_rows   = total_transaction_rows - 1,
    last_updated_transaction = NOW();
END IF;
RETURN NULL;
END;
$$;
CREATE TABLE rollapp_checkin.message (
    transaction_hash text NOT NULL,
    index bigint NOT NULL,
    type text NOT NULL,
    value jsonb NOT NULL,
    involved_accounts_addresses text[] NOT NULL,
    partition_id bigint DEFAULT 0 NOT NULL,
    height bigint NOT NULL
)
PARTITION BY LIST (partition_id);
CREATE FUNCTION rollapp_checkin.messages_by_address(addresses text[], types text[], "limit" bigint DEFAULT 100, "offset" bigint DEFAULT 0) RETURNS SETOF rollapp_checkin.message
    LANGUAGE sql STABLE
    AS $$
SELECT * FROM message
WHERE (cardinality(types) = 0 OR type = ANY (types))
  AND addresses && involved_accounts_addresses
ORDER BY height DESC LIMIT "limit" OFFSET "offset"
$$;
CREATE FUNCTION rollapp_checkin.messages_by_type(types text[], "limit" bigint DEFAULT 100, "offset" bigint DEFAULT 0) RETURNS SETOF rollapp_checkin.message
    LANGUAGE sql STABLE
    AS $$ 
SELECT * FROM message
WHERE (cardinality(types) = 0 OR type = ANY (types))
ORDER BY height DESC LIMIT "limit" OFFSET "offset" 
$$;
CREATE FUNCTION rollapp_checkin.update_check_in_record_statistics() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
    v_region_id text;
    v_day date;
    v_delta int := 0;
    v_address text;
BEGIN
    IF TG_OP = 'INSERT' THEN
        v_address := NEW.address;
        v_day := (NEW.check_in_time AT TIME ZONE 'UTC')::date;
        v_delta := 1;
    ELSIF TG_OP = 'DELETE' THEN
        v_address := OLD.address;
        v_day := (OLD.check_in_time AT TIME ZONE 'UTC')::date;
        v_delta := -1;
    ELSE
        RETURN NULL;
    END IF;
    -- 从public.dids表中获取region_id
    SELECT region_id INTO v_region_id
    FROM public.dids
    WHERE address = v_address
    LIMIT 1;
    IF v_region_id IS NULL THEN
        v_region_id := '';
    END IF;
    INSERT INTO rollapp_checkin.check_in_record_statistics(region_id, day, check_in_count)
    VALUES (v_region_id, v_day, v_delta)
    ON CONFLICT (region_id, day)
    DO UPDATE SET check_in_count = rollapp_checkin.check_in_record_statistics.check_in_count + v_delta;
    RETURN NULL;
END;
$$;
