CREATE VIEW public.amount_in_tx_view AS
 SELECT transfer_in_msgs.tx_hash,
    sum((NULLIF("substring"(transfer_in_msgs.coins, '([0-9]+)ugea.*'::text), '0'::text))::numeric) AS total_coins
   FROM public.transfer_in_msgs
  GROUP BY transfer_in_msgs.tx_hash;
