 SELECT fr.height,
    fr.fee_denom,
    sum(fr.fee_amount) AS total_fee
   FROM public.fee_records fr
  GROUP BY fr.height, fr.fee_denom;
CREATE TABLE rollapp_checkin.block (
    height bigint NOT NULL,
