    num_txs integer DEFAULT 0,
    total_gas bigint DEFAULT 0,
    proposer_address text,
    "timestamp" timestamp with time zone NOT NULL
)
PARTITION BY RANGE (height);
CREATE VIEW public.block_multi_net AS
 SELECT pb.height,
    pb.hash,
    'hub'::text AS net_type,
    pb.num_txs,
    pb.total_gas,
    pb.proposer_address,
    pb."timestamp"
   FROM public.block pb
UNION ALL
 SELECT rcb.height,
    rcb.hash,
    'rollapp_checkin'::text AS net_type,
    rcb.num_txs,
    rcb.total_gas,
    rcb.proposer_address,
    rcb."timestamp"
   FROM rollapp_checkin.block rcb;
