CREATE VIEW public.daily_transaction_counts_view AS
 SELECT row_number() OVER (ORDER BY subquery.record_date) AS id,
    subquery.record_date,
    subquery.nums
   FROM ( SELECT ((b."timestamp" AT TIME ZONE 'UTC'::text))::date AS record_date,
            sum(b.num_txs) AS nums
           FROM public.block b
          GROUP BY (((b."timestamp" AT TIME ZONE 'UTC'::text))::date)) subquery;
