CREATE VIEW public.fee_records_multi_net AS
 SELECT pfr.id,
    pfr.created_at,
    pfr.updated_at,
    pfr.deleted_at,
    pfr.height,
    pfr.tx_hash,
    'hub'::text AS net_type,
    pfr.fee_payer,
    pfr.fee_amount,
    pfr.fee_denom,
    pfr.invoke_address,
    pfr.receivers,
    pfr.partition_id
   FROM public.fee_records pfr;
