CREATE VIEW public.ibc_transfer_msgs AS
 SELECT tim.id,
    tim.created_at,
    tim.updated_at,
    tim.deleted_at,
    tim.tx_hash,
    tim.height,
    tim.msg_index,
    tim.msg_type,
    tim.sender,
    tim.receiver,
    tim.invoke_address,
    tim.coins,
    tim.token_types
   FROM public.transfer_in_msgs tim
  WHERE (tim.has_ibc_token = true);
CREATE VIEW public.ibc_token_count AS
 SELECT t.denom,
    COALESCE(count(DISTINCT tim.tx_hash), (0)::bigint) AS transaction_count,
    COALESCE(count(DISTINCT bs.address), (0)::bigint) AS holder_count
   FROM ((public.ibc_tokens t
     LEFT JOIN public.ibc_transfer_msgs tim ON ((ARRAY[t.denom] @> tim.token_types)))
     LEFT JOIN public.balance_states bs ON ((ARRAY[t.denom] @> bs.token_types)))
  GROUP BY t.denom;
CREATE VIEW public.ibc_token_tx_count_view AS
 SELECT count(*) AS count,
    sub1.denom
   FROM ( SELECT DISTINCT subq.tx_hash,
            it.denom
           FROM (public.ibc_tokens it
             RIGHT JOIN ( SELECT tim.tx_hash,
                    tim.token_types
                   FROM public.transfer_in_msgs tim
                  WHERE (tim.has_ibc_token = true)) subq ON ((subq.token_types @> ARRAY[it.denom])))) sub1
  GROUP BY sub1.denom;
CREATE SEQUENCE public.ibc_tokens_id_seq
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1;
ALTER SEQUENCE public.ibc_tokens_id_seq OWNED BY public.ibc_tokens.id;
