CREATE VIEW public.message_multi_net AS
 SELECT pm.transaction_hash,
    'hub'::text AS net_type,
    pm.index,
    pm.type,
    pm.value,
    pm.involved_accounts_addresses,
    pm.partition_id,
    pm.height
   FROM public.message pm
UNION ALL
 SELECT rcm.transaction_hash,
    'rollapp_checkin'::text AS net_type,
    rcm.index,
    rcm.type,
    (rcm.value)::json AS value,
    rcm.involved_accounts_addresses,
    rcm.partition_id,
    rcm.height
   FROM rollapp_checkin.message rcm;
CREATE VIEW public.transfer_in_msgs_split_ugea_coin_view AS
 SELECT transfer_in_msgs.id,
    transfer_in_msgs.created_at,
    transfer_in_msgs.updated_at,
    transfer_in_msgs.deleted_at,
    transfer_in_msgs.tx_hash,
    transfer_in_msgs.height,
    transfer_in_msgs.msg_index,
    transfer_in_msgs.msg_type,
    transfer_in_msgs.sender,
    transfer_in_msgs.receiver,
    transfer_in_msgs.invoke_address,
    transfer_in_msgs.ugea,
    transfer_in_msgs.ugag,
    transfer_in_msgs.coins,
    transfer_in_msgs.token_types,
    transfer_in_msgs.has_ibc_token,
    transfer_in_msgs.tag,
    (NULLIF("substring"(transfer_in_msgs.coins, '([0-9]+)ugea.*'::text), '0'::text))::numeric AS ugea_coin_amount,
    'ugea'::text AS coin_denom
   FROM public.transfer_in_msgs;
CREATE VIEW public.message_transfers_multi_net AS
 SELECT pmt.id,
