    'hub'::text AS net_type,
    pmt.height,
    pmt.msg_index,
    pmt.msg_type,
    pmt.sender,
    pmt.receiver,
    pmt.invoke_address,
    pmt.coins,
    pmt.token_types,
    pmt.has_ibc_token,
    pmt.ugea_coin_amount,
    pmt.coin_denom
   FROM public.transfer_in_msgs_split_ugea_coin_view pmt;
