    coins text,
    token_types text[],
    trigger_by text,
    has_ibc_token boolean,
    tag text
)
PARTITION BY RANGE (height);
CREATE VIEW public.transfer_combine_view AS
 SELECT tim.msg_type AS type,
    tim.height,
    tim.tx_hash,
    tim.sender AS from_address,
    tim.receiver AS to_address,
    tim.coins AS amount,
    tim.invoke_address,
    tim.msg_index,
    tim.token_types,
    tim.has_ibc_token,
    tim.tag
   FROM public.transfer_in_msgs tim
UNION ALL
 SELECT 'mint'::text AS type,
    b.height,
    NULL::text AS tx_hash,
    'coinbase'::text AS from_address,
    'gea1m3h30wlvsf8llruxtpukdvsy0km2kum8x0zdjw'::text AS to_address,
    mr.mint AS amount,
    ARRAY['gea1m3h30wlvsf8llruxtpukdvsy0km2kum8x0zdjw'::text] AS invoke_address,
    NULL::integer AS msg_index,
    ARRAY['ugea'::text, 'ugag'::text] AS token_types,
    false AS has_ibc_token,
    'mint'::text AS tag
   FROM (public.mint_records mr
     JOIN public.block b ON (((b.height >= mr.start_height) AND (b.height <= mr.end_height))))
UNION ALL
 SELECT 'transfer_in_abci'::text AS type,
    tia.height,
    NULL::text AS tx_hash,
    tia.sender AS from_address,
    tia.receiver AS to_address,
    tia.coins AS amount,
    tia.invoke_address,
    NULL::integer AS msg_index,
    tia.token_types,
    tia.has_ibc_token,
    tia.tag
   FROM public.transfer_in_abci tia;
CREATE VIEW public.module_account_transfers AS
 WITH module_addresses AS (
         SELECT array_agg(module_accounts.address) AS addresses
           FROM public.module_accounts
        )
 SELECT view_t.type,
    view_t.height,
    view_t.tx_hash,
    view_t.from_address,
    view_t.to_address,
    view_t.amount,
    view_t.invoke_address,
    view_t.msg_index,
    view_t.token_types,
    view_t.has_ibc_token,
    view_t.tag
   FROM public.transfer_combine_view view_t,
    module_addresses ma
  WHERE (view_t.invoke_address && ma.addresses);
