CREATE MATERIALIZED VIEW public.mv_unique_account_last_active AS
 SELECT all_records.address,
    max(all_records.last_active_time) AS last_active_time
   FROM ( SELECT account_active_record.address,
            account_active_record.last_active_time
           FROM public.account_active_record
        UNION ALL
         SELECT account_active_record.address,
            account_active_record.last_active_time
           FROM rollapp_checkin.account_active_record) all_records
  GROUP BY all_records.address
  WITH NO DATA;
