    uri_hash text,
    holder text
);
CREATE VIEW public.nft_class_count AS
 SELECT nc.id,
    COALESCE(h.holder_count, (0)::bigint) AS holder_count,
    COALESCE(t.tx_count, (0)::bigint) AS transaction_count
   FROM ((public.nft_classes nc
     LEFT JOIN ( SELECT nfts.class_id,
            count(DISTINCT nfts.holder) AS holder_count
           FROM public.nfts
          GROUP BY nfts.class_id) h ON ((nc.id = h.class_id)))
     LEFT JOIN ( SELECT nft_txes.class_id,
            count(DISTINCT nft_txes.tx_hash) AS tx_count
           FROM public.nft_txes
          GROUP BY nft_txes.class_id) t ON ((nc.id = t.class_id)));
CREATE VIEW public.nft_class_holder_count AS
 SELECT nc.id AS class_id,
    n.holder,
    count(n.*) AS holder_count
   FROM (public.nft_classes nc
     LEFT JOIN public.nfts n ON ((nc.id = n.class_id)))
  WHERE (n.holder IS NOT NULL)
  GROUP BY nc.id, n.holder;
CREATE TABLE public.tx_indices (
    tx_hash text NOT NULL,
    height bigint,
    index bigint
);
CREATE VIEW public.nfts_with_last_tx AS
 SELECT n.id,
    n.create_height,
    n.update_height,
    n.delete_height,
    n.class_id,
    n.uri,
    n.uri_hash,
    n.holder,
    last_tx.tx_hash AS last_tx_hash
   FROM (public.nfts n
     LEFT JOIN LATERAL ( SELECT nt.tx_hash
           FROM (public.nft_txes nt
             JOIN public.tx_indices ti ON ((nt.tx_hash = ti.tx_hash)))
          WHERE ((nt.id = n.id) AND (nt.class_id = n.class_id))
          ORDER BY ti.height DESC, ti.index DESC
         LIMIT 1) last_tx ON (true));
