CREATE VIEW public.parsed_message_multi_net AS
 SELECT ppm.height,
    ppm.tx_hash,
    ppm.msg_index,
    'hub'::text AS net_type,
    ppm.detail,
    ppm.msg_type,
    ppm.description
   FROM public.parsed_message ppm;
