);
CREATE VIEW public.proposal_vote_summary_by_vote_address_and_result_view AS
 SELECT committee_proposal_vote_infos.proposal_id,
    committee_proposal_vote_infos.is_support,
    committee_proposal_vote_infos.vote_address,
    sum(committee_proposal_vote_infos.vote_amount_ugag) AS total_vote_amount
   FROM public.committee_proposal_vote_infos
  GROUP BY committee_proposal_vote_infos.proposal_id, committee_proposal_vote_infos.vote_address, committee_proposal_vote_infos.is_support;
CREATE VIEW public.proposal_vote_summary_by_address_count_view AS
 SELECT proposal_vote_summary_by_vote_address_and_result_view.proposal_id,
    count(
        CASE
            WHEN proposal_vote_summary_by_vote_address_and_result_view.is_support THEN 1
            ELSE NULL::integer
        END) AS support_address_count,
    count(
        CASE
            WHEN (NOT proposal_vote_summary_by_vote_address_and_result_view.is_support) THEN 1
            ELSE NULL::integer
        END) AS against_address_count
   FROM public.proposal_vote_summary_by_vote_address_and_result_view
  GROUP BY proposal_vote_summary_by_vote_address_and_result_view.proposal_id;
CREATE VIEW public.proposal_vote_summary_by_vote_result_view AS
 SELECT committee_proposal_vote_infos.proposal_id,
    committee_proposal_vote_infos.is_support,
    sum(committee_proposal_vote_infos.vote_amount_ugag) AS total_vote_amount
   FROM public.committee_proposal_vote_infos
  GROUP BY committee_proposal_vote_infos.proposal_id, committee_proposal_vote_infos.is_support;
CREATE TABLE public.proposer_tx_summary (
