CREATE VIEW public.raw_block_log_view AS
 SELECT rb.height,
    (convert_from(rb.raw_data, 'UTF8'::name))::json AS block,
    (convert_from(rb.raw_block_result, 'UTF8'::name))::json AS log
   FROM public.raw_blocks rb;
