CREATE TABLE public.staking_trends (
    date timestamp with time zone NOT NULL,
    region_id text NOT NULL,
    height bigint,
    delegate_amount public.big_int_coin,
    fixed_deposit_amount public.big_int_coin,
    individual_equity_holdings public.big_int_coin,
    lock_up_amount public.big_int_coin,
    total_stake public.big_int_coin
);
CREATE VIEW public.region_delegation_view AS
 SELECT DISTINCT ON (st.region_id) st.region_id,
    'nil'::text AS approve_region_id,
    (st.individual_equity_holdings).amount AS kyc_amount,
    (st.delegate_amount).amount AS delegation_amount,
    (st.fixed_deposit_amount).amount AS fixed_deposit_amount,
    (st.lock_up_amount).amount AS lock_up_deposit_amount,
    st.height,
    GREATEST(((rs.current_lock_up_total_ugea + (rs.current_kyc_amount * (100000000)::numeric)) - (0.51 * (rs.region_total_kyc_amount_gea * (100000000)::numeric))), (0)::numeric) AS undelegateable_amount,
    GREATEST(((rs.current_lock_up_total_ugea + (rs.current_kyc_amount * (100000000)::numeric)) / (rs.region_total_kyc_amount_gea * (100000000)::numeric)), (0)::numeric) AS age_ratio
   FROM (public.staking_trends st
     LEFT JOIN public.region_states rs ON ((st.region_id = rs.region_id)))
  ORDER BY st.region_id, st.height DESC;
CREATE VIEW public.region_liquidity_view AS
 SELECT rs.region_id,
    COALESCE(treasurequery.treasure_amount, (0)::numeric) AS treasure_amount,
    COALESCE(subquery.user_balance, (0)::numeric) AS liquidity
   FROM ((public.region_states rs
     LEFT JOIN ( SELECT c.data AS region_id,
            sum(bs.ugea_amount) AS user_balance
           FROM ((public.balance_states bs
             LEFT JOIN public.dids d ON ((d.address = bs.address)))
             LEFT JOIN public.credentials c ON ((c.did = d.did)))
          WHERE (c.sid = 'kyc'::text)
          GROUP BY c.data) subquery ON ((rs.region_id = subquery.region_id)))
     LEFT JOIN ( SELECT rs_2.region_id,
            bs.ugea_amount AS treasure_amount
           FROM (public.balance_states bs
             RIGHT JOIN public.region_states rs_2 ON ((bs.address = rs_2.base_account)))) treasurequery ON ((rs.region_id = treasurequery.region_id)));
CREATE VIEW public.region_states_with_all_delegation AS
 SELECT region_states.region_id,
    region_states.current_lock_up_total_ugea,
    region_states.current_fixed_delegation_total_ugea,
    region_states.current_normal_delegation_total_ugea,
    ((COALESCE(region_states.current_lock_up_total_ugea, (0)::numeric) + COALESCE(region_states.current_fixed_delegation_total_ugea, (0)::numeric)) + COALESCE(region_states.current_normal_delegation_total_ugea, (0)::numeric)) AS current_all_delegation_total_ugea
   FROM public.region_states
  WHERE (region_states.deleted_at IS NULL);
CREATE TABLE public.region_total_interests (
    region_id text NOT NULL,
    current_total_delegation_interest numeric,
    current_total_lockup_interest numeric
);
