CREATE VIEW public.stake_trend_view AS
 WITH monthly_max_dates AS (
         SELECT date_trunc('month'::text, (staking_trends.date AT TIME ZONE 'UTC'::text)) AS month_start,
            max(staking_trends.date) AS max_date
           FROM public.staking_trends
          GROUP BY (date_trunc('month'::text, (staking_trends.date AT TIME ZONE 'UTC'::text)))
        )
 SELECT st.date AS at_date,
    to_char(date_trunc('month'::text, (st.date AT TIME ZONE 'UTC'::text)), 'YYYY-MM'::text) AS date,
    st.region_id,
    st.height,
    st.delegate_amount,
    st.fixed_deposit_amount,
    st.individual_equity_holdings,
    st.lock_up_amount,
    st.total_stake
   FROM (public.staking_trends st
     JOIN monthly_max_dates mmd ON (((date_trunc('month'::text, (st.date AT TIME ZONE 'UTC'::text)) = mmd.month_start) AND (st.date = mmd.max_date))));
