CREATE MATERIALIZED VIEW public.sub_region_delegation_view AS
 SELECT sr.region_id,
    sr.approve_region_id,
    COALESCE(sum(sr.kyc_amount), (0)::numeric) AS kyc_amount,
    COALESCE(sum(sr.delegation_amount), (0)::numeric) AS delegation_amount,
    COALESCE(sum(sr.fixed_deposit_amount), (0)::numeric) AS fixed_deposit_amount,
    COALESCE(sum(sr.lock_up_deposit_amount), (0)::numeric) AS lock_up_deposit_amount
   FROM ( SELECT sc.address,
            sc.region_id,
            COALESCE(ds.approve_region_id, ''::text) AS approve_region_id,
            COALESCE(sc.kyc_amount, (0)::numeric) AS kyc_amount,
            COALESCE(sc.delegation_amount, (0)::numeric) AS delegation_amount,
            COALESCE(sc.fixed_deposit_amount, (0)::numeric) AS fixed_deposit_amount,
            COALESCE(sc.lock_up_deposit_amount, (0)::numeric) AS lock_up_deposit_amount
           FROM (public.staking_counts sc
             JOIN public.dids ds ON ((sc.address = ds.address)))
          WHERE (sc.region_id = 'global_village'::text)) sr
  GROUP BY sr.region_id, sr.approve_region_id
  WITH NO DATA;
