CREATE VIEW public.supply_view AS
 SELECT supply.one_row_id,
    coin.denom,
    coin.amount
   FROM public.supply,
    LATERAL unnest(supply.coins) coin(denom, amount)
  WHERE (((supply.one_row_id = true) AND (coin.denom = 'ugea'::text)) OR (coin.denom = 'ugag'::text));
