CREATE VIEW public.transfer_in_msgs_split_ugag_coin_view AS
 SELECT transfer_in_msgs.id,
    transfer_in_msgs.created_at,
    transfer_in_msgs.updated_at,
    transfer_in_msgs.deleted_at,
    transfer_in_msgs.tx_hash,
    transfer_in_msgs.height,
    transfer_in_msgs.msg_index,
    transfer_in_msgs.msg_type,
    transfer_in_msgs.sender,
    transfer_in_msgs.receiver,
    transfer_in_msgs.invoke_address,
    transfer_in_msgs.ugea,
    transfer_in_msgs.ugag,
    transfer_in_msgs.coins,
    transfer_in_msgs.token_types,
    transfer_in_msgs.has_ibc_token,
    transfer_in_msgs.tag,
    (NULLIF("substring"(transfer_in_msgs.coins, '([0-9]+)ugag.*'::text), '0'::text))::numeric AS ugag_coin_amount,
    'ugag'::text AS coin_denom
   FROM public.transfer_in_msgs;
CREATE TABLE public.transfer_records (
    id bigint NOT NULL,
    created_at timestamp with time zone,
    updated_at timestamp with time zone,
    deleted_at timestamp with time zone,
    height bigint NOT NULL,
