CREATE VIEW public.tx_signers_multi_net AS
 SELECT pts.tx_hash,
    'hub'::text AS net_type,
    pts.created_at,
    pts.updated_at,
    pts.deleted_at,
    pts.signers,
    pts.fee_payer
   FROM public.tx_signers pts;
CREATE TABLE public.unbonding_records (
    id bigint NOT NULL,
    created_at timestamp with time zone,
    updated_at timestamp with time zone,
    deleted_at timestamp with time zone,
    height bigint,
    amount text,
    region_id text,
    delegator_address text
);
CREATE SEQUENCE public.unbonding_records_id_seq
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1;
ALTER SEQUENCE public.unbonding_records_id_seq OWNED BY public.unbonding_records.id;
CREATE TABLE public.update_keys (
