CREATE TABLE public.validator_voting_power (
    validator_address text NOT NULL,
    voting_power bigint NOT NULL,
    height bigint NOT NULL
);
CREATE TABLE public.vesting_account (
    id integer NOT NULL,
    type text NOT NULL,
    address text NOT NULL,
