    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1;
ALTER SEQUENCE rollapp_checkin.check_in_record_id_seq OWNED BY rollapp_checkin.check_in_record.id;
CREATE TABLE rollapp_checkin.check_in_record_statistics (
    region_id text NOT NULL,
    day date NOT NULL,
    check_in_count bigint DEFAULT 0 NOT NULL
);
CREATE VIEW rollapp_checkin.checkin_by_month_detail_view AS
 SELECT cir.address,
    to_char((cir.check_in_time AT TIME ZONE 'UTC'::text), 'YYYY-MM'::text) AS time_str,
    count(*) AS check_in_count,
    EXTRACT(year FROM cir.check_in_time) AS year,
    EXTRACT(month FROM cir.check_in_time) AS month
   FROM rollapp_checkin.check_in_record cir
  GROUP BY cir.address, (to_char((cir.check_in_time AT TIME ZONE 'UTC'::text), 'YYYY-MM'::text)), (EXTRACT(year FROM cir.check_in_time)), (EXTRACT(month FROM cir.check_in_time))
 HAVING (count(*) >= 25)
  ORDER BY (to_char((cir.check_in_time AT TIME ZONE 'UTC'::text), 'YYYY-MM'::text)) DESC;
CREATE VIEW rollapp_checkin.checkin_by_month_view AS
 SELECT subquery.month,
    count(DISTINCT subquery.address) AS address_count
   FROM ( SELECT cir.address,
            to_char((cir.check_in_time AT TIME ZONE 'UTC'::text), 'YYYY-MM'::text) AS month
           FROM rollapp_checkin.check_in_record cir
          GROUP BY cir.address, (to_char((cir.check_in_time AT TIME ZONE 'UTC'::text), 'YYYY-MM'::text))
         HAVING (count(*) >= 25)) subquery
  GROUP BY subquery.month
  ORDER BY subquery.month DESC;
CREATE VIEW rollapp_checkin.checkin_count_view AS
 SELECT cirs.region_id,
    sum(COALESCE(cirs.check_in_count, (0)::bigint)) AS check_in_count
   FROM rollapp_checkin.check_in_record_statistics cirs
  GROUP BY cirs.region_id;
CREATE VIEW rollapp_checkin.checkin_today_count_view AS
 SELECT cirs.region_id,
    cirs.day,
    cirs.check_in_count
   FROM rollapp_checkin.check_in_record_statistics cirs
  WHERE (cirs.day = ((now() AT TIME ZONE 'UTC'::text))::date);
